use banking;
desc transactions;
drop table transactions;

create table transactions(
tran_id int auto_increment not null,
tran_acc_number varchar (50) not null,
trans_type enum('debit','credit') not null,
trans_form varchar (50) not null,
trans_to varchar (50) not null,
trans_remarks text not null,
trans_amount decimal(10,2) not null,
trans_balance decimal(10,2) not null,
trans_date date not null,
trans_time time not null,
primary key(tran_id),
foreign key(tran_acc_number) references Customers(customer_account_number),
check (trans_type in ('debit','credit')));

